import './styles/App.css';
import { FaFacebook, FaSearch, FaAlignJustify } from 'react-icons/fa';
import react_logo from './img/react-logo.png';

import Header from './Header.js';

function App() {
  return (
    <div className='App'>
      <Header></Header>
      <div className='stories'>
        <div className='storiesCard' style={{backgroundImage:`url()`}}>
          <p>Usuario X</p>
        </div>
      </div>
    </div>
  );
}

export default App;
